import styled from "styled-components";
import Check from "../Img/ei_check.svg";

interface TODOOBJ {
  name: string;
  tag: string;
  color: string;
}

const TodoList = styled.li`
  display: flex;
  width: 100%;
  height: 100px;
  min-height: 100px;
  background: var(--white);
  border-radius: 30px;
  padding: 10px;
  align-items: center;
`;

const CheckBtn = styled.button`
  width: auto;
  height: auto;

  > img {
    backgrond: black;
    path {
      stroke: black;
      fill: black;
    }
    &:hover {
      path {
        stroke: white;
        fill: black;
      }
    }
  }
`;

export default function TodoLi(props: { todo: TODOOBJ }) {
  const { name, tag, color } = props.todo;
  return (
    <TodoList>
      <CheckBtn>
        <img src={Check} alt="checkbutton" />
      </CheckBtn>
      {name} {tag} {color}
    </TodoList>
  );
}
